import React from 'react';
import Sidebar from './components/Sidebar';
import Header from './Header';
import PolicyTable from './PolicyTable';
import './App.css';

function App() {
  return (
    <div className="app">
      <Sidebar />
      <div className="main-content">
        <Header />
        <PolicyTable />
      </div>
    </div>
  );
}

export default App;
